  false,\n\t\"url\": null,\n\t\"notes\": \"This report supports the proposal by Blackwater
  National Wildlife Refuge for the utilization of trapping as a management tool for
  control of furbearer populations for the period January 1 to March 15, 1994. Removing
  excess numbers of furbearers maintains stable populations, thereby protecting habitat
  and preventing disease. Trapping also provides economic benefits to the local community.
  Controlling furbearer populations is instrumental to meeting the refuge's primary
  objectives for waterfowl, endangered species, and public use.\",\n\t\"license_title\":
